import { ProductConsumer } from "../context";
import { Link } from "react-router-dom";
import { ButtonContainer } from "./Button";

export default class Details extends Component {
  render() {
    return (
      <ProductConsumer>
        {value => {
          const {
            id,
            company,
            img,
            info,
            price,
            tittle,
            inCart
          } = value.detailProduct;
          return (
            <div className="container py-5">
              
            </div>
          )
        }}
      </ProductConsumer>
    );
  }
}
